                                    "description" : "<p style=\"margin-bottom: 10px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; font-family: Verdana, 'Lucida Sans', 'Lucida Grande', 'Lucida Sans Unicode', sans-serif; line-height: 18px; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">The Winery Train Tour is available Monday through Friday, year round except for Memorial Day, July 4, Labor Day, Thanksgiving Day, Christmas Day, and New Year's Day.</p><p style=\"margin-bottom: 10px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; font-family: Verdana, 'Lucida Sans', 'Lucida Grande', 'Lucida Sans Unicode', sans-serif; line-height: 18px; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Guided Winery Train Tour includes:</p><p style=\"margin-bottom: 10px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; font-family: Verdana, 'Lucida Sans', 'Lucida Grande', 'Lucida Sans Unicode', sans-serif; line-height: 18px; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">VIP wine tastings at boutique wineries: 18 tastes of local wines, drinking on the train, luscious light lunch with fine-wine pairing, wine-and-cheese pairings, and wine-and-chocolate pairings.</p><p style=\"margin-bottom: 10px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; font-family: Verdana, 'Lucida Sans', 'Lucida Grande', 'Lucida Sans Unicode', sans-serif; line-height: 18px; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Explore San Diego’s rich history on guided historic walks, behind-the-scenes of the wine-making process, and a wine-tasting appreciation presentation.<br><br>Option to choose local craft beers -- no additional charge. Beer tasting at the local brewery also available at no additional charge.</p><p style=\"margin-bottom: 10px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; font-family: Verdana, 'Lucida Sans', 'Lucida Grande', 'Lucida Sans Unicode', sans-serif; line-height: 18px; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Train ticket $12 per person, which you will purchase separately on day of tour.</p><p style=\"margin-bottom: 10px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; font-family: Verdana, 'Lucida Sans', 'Lucida Grande', 'Lucida Sans Unicode', sans-serif; line-height: 18px; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Train tour includes a total of about two miles of walking, about 15 minute walks at a time.</p>",
